import * as React from 'react';
import './navbar.css';

export class Navbar extends React.Component{
    render() {
        return (
            <div className="container-fluid">
                <nav className="navbar navbar-expand-md">
                    <div className="navbar-nav">
                        <a className="nav-item nav-link" href="#">Sobre o NEU</a>
                        <a className="nav-item nav-link" href="#">Pré-aceleração</a>
                        <a className="nav-item nav-link" href="#">Estágios</a>
                        <a className="nav-item nav-link" href="#">Eventos</a>
                        <a className="nav-item nav-link" href="#">Parcerias</a>
                        <a className="nav-item nav-link" href="#">E-book</a>
                        <a className="nav-item nav-link" href="#">Cursos Online</a>
                        <a className="nav-item nav-link" href="#">Fale Conosco</a>
                    </div>
                </nav>
            </div>
        )
    }
}
